def nested_if_statements_and_tuples(n):
    """
    Write a program that takes an integer n and returns the sum of all the integers between 0 and n-1 that are divisible by 3 or 4.
    """
    total = 0
    for i in range(n):
        if i % 3 == 0 or i % 4 == 0:
            total += i
    return total
